syntax = "proto2";

import "RankShowData.proto";
message GetOpenworldBossHuntRankRsp {
    required Retcode retcode = 1;
    optional uint32 map_id = 2;
    required RankShowData rank_data = 3;

    enum CmdId {
        CMD_ID = 4534;
    }
    enum Retcode {
        SUCC = 0;
        FAIL = 1;
    }
}